import React from 'react';

const Pourquoi = () => (
  <>
    <h2>Pourquoi wecraftapps</h2>
      <p>Le graphisme de votre site m'a immédiatement accroché. Les six projets présentés sont tous différents, techniquement mais également en terme de demande métier. L'agence est composée d'une dizaine de personnes, c'est un ordre de grandeur qui me sied parfaitement ayant une préférence pour les petites unités. La forte répartition web des activités de l’agence avec une proportion mobile non négligeable est également un point d’intérêt fort de ma part. Le web se consommant majoritairement sur mobile désormais, une approche technique mobile est un énorme avantage pour mon évolution future.
</p>
  </>
);

export default Pourquoi;
